// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import CasualPage from './components/CasualPage';
import ProfessionalPage from './components/ProfessionalPage';
import Portfolio from './components/Portfolio';
import ResumeAndCertificates from './components/ResumeAndCertificates';
import AboutMe from './components/AboutMe';
import Contact from './components/Contact';
import Skills from './components/Skills';
import Services from './components/Services';
import LayoutWithNavbar from './components/NavBar/LayoutWithNavbar';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<div>Home Content</div>} />
        <Route path="/casual" element={<CasualPage />} />
        <Route path="/professional" element={<ProfessionalPage />} />
        <Route path="/casual/portfolio/*" element={<Portfolio />} />
        <Route path="/professional/portfolio/*" element={<Portfolio />} />
        <Route path="/casual/resume-and-certificates/*" element={<ResumeAndCertificates />} />
        <Route path="/casual/about-me/*" element={<AboutMe />} />
        <Route path="/casual/contact/*" element={<Contact />} />
        <Route path="/casual/skills/*" element={<Skills />} />
        <Route path="/casual/services/*" element={<Services />} />
        {/* ... other casual routes */}
        <Route path="/professional/resume-and-certificates/*" element={<ResumeAndCertificates />} />
        <Route path="/professional/about-me/*" element={<AboutMe />} />
        <Route path="/professional/contact/*" element={<Contact />} />
        <Route path="/professional/skills/*" element={<Skills />} />
        <Route path="/professional/services/*" element={<Services />} />
        {/* ... other professional routes */}
      </Routes>
    </Router>
  );
};

export default App;
